INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1014501043, /*drama_id*/1014501, /*command_type*/11, /*param_01*/101411, /*param_02*/"こんなに手の込んだケーキ、\n用意するのは大変だっただろう？\nいい助手をもって幸せだよ、私は。", /*param_03*/6, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
