INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1014501046, /*drama_id*/1014501, /*command_type*/11, /*param_01*/101411, /*param_02*/"えっ？　食べさせてくれる？\nい、いや、遠慮しておくよ！\nそこまでしてもらうには……！\n確かに今日は、特別な日だけど……！", /*param_03*/5, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
