INSERT INTO `birthday_login_bonus_drama_script` VALUES (/*command_id*/1014501049, /*drama_id*/1014501, /*command_type*/11, /*param_01*/101411, /*param_02*/"特別な……うん、そうだよね。\n誕生日くらい、甘えてもいいのかな。\nじゃあ、私と助手くんだけの秘密だよ？\nあ～ん……や、やっぱり恥ずかしい……", /*param_03*/4, /*param_04*/1, /*param_05*/1, /*param_06*/0, /*param_07*/0, /*param_08*/"");
